import { FETCH_FOODS } from "../constants/actionTypes"

export const foods = (state = { products: [] }, action) => {
  switch (action.type) {
    case FETCH_FOODS:        
      return { ...state, products: action.payload.data } 
      
    default:
      return state;
  }
}

export default foods
